    #两字词：取每字全码的前两码組成，共四码
    - length_equal: 2
      formula: "AaAbBaBb"
    #三字词：前两個字各取第一码，最后一字取前两码，共四码
    - length_equal: 3
      formula: "AaBaCaCb"
    #多字词：取第一、二、三及末一個汉字的第一码，共四码
